import React, { useState, useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import Categories from '../components/cards/Categories';
import axios from 'axios';

function Welcome() {
  const [showProfile, setShowProfile] = useState(false);
  const [user, setUser] = useState(null);
  const [editMode, setEditMode] = useState(false);
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    phone: '',
    password: ''
  });

  // Load user data from localStorage
  useEffect(() => {
    const email = localStorage.getItem("email");
    const password = localStorage.getItem("password");

    if (email && password) {
      // First try fetching from User
      axios.get("https://localhost:44352/User")
        .then(response => {
          const foundUser = response.data.find(u => u.email === email && u.password === password);
          if (foundUser) {
            setUser(foundUser);
            setFormData(foundUser);
            return;
          }

          // If not found in User, try Admin
          return axios.get("https://localhost:44352/Admin");
        })
        .then(response => {
          if (response && response.data) {
            const foundAdmin = response.data.find(a => a.email === email && a.password === password);
            if (foundAdmin) {
              setUser(foundAdmin);
              setFormData(foundAdmin);
            }
          }
        })
        .catch(error => console.error("Error fetching user/admin:", error));
    }
  }, []);

  const handleEditToggle = () => {
    setEditMode(!editMode);
  };

  const handleChange = e => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleUpdate = () => {
    alert("Update logic here (optional)");
    setEditMode(false);
  };

  return (
    <div className="container mt-3">
      <div className="d-flex justify-content-end">
        <button className="btn btn-outline-primary me-2" onClick={() => setShowProfile(false)}>Home</button>
        <button className="btn btn-outline-success" onClick={() => setShowProfile(true)}>My Profile</button>
      </div>

      {showProfile ? (
        <div className="mt-4">
          <h2 className="text-center">My Profile</h2>
          {!user ? (
            <p className="text-center">Loading profile...</p>
          ) : (
            <div className="card p-4 shadow">
              <div className="mb-3">
                <label>Name:</label>
                {editMode ? (
                  <input type="text" className="form-control" name="name" value={formData.name} onChange={handleChange} />
                ) : (
                  <p>{formData.name}</p>
                )}
              </div>
              <div className="mb-3">
                <label>Email:</label>
                {editMode ? (
                  <input type="email" className="form-control" name="email" value={formData.email} onChange={handleChange} />
                ) : (
                  <p>{formData.email}</p>
                )}
              </div>
              <div className="mb-3">
                <label>Phone:</label>
                {editMode ? (
                  <input type="text" className="form-control" name="phone" value={formData.phone} onChange={handleChange} />
                ) : (
                  <p>{formData.phone}</p>
                )}
              </div>

              <div className="text-center">
                <button className="btn btn-warning me-2" onClick={handleEditToggle}>
                  {editMode ? 'Cancel' : 'Edit'}
                </button>
                {editMode && <button className="btn btn-primary" onClick={handleUpdate}>Update</button>}
              </div>
            </div>
          )}
        </div>
      ) : (
        <Categories />
      )}
    </div>
  );
}

export default Welcome;
